export class MacoUniformPack extends BaseNeckProvider implements IUniformPack {

    getRankSwatches(): Swatch[] {
        return [
            new Swatch(Rank.None, "None", (token) => MacoUniformPack.decorateSwatch("", Rank.None, token), "Rank.none.name"),
            new Swatch(Rank.Colonel, "Colonel", (token) => MacoUniformPack.decorateSwatch(macoRanks.border.colonel, Rank.Colonel, token), "Rank.colonel.name"),
            new Swatch(Rank.LieutenantColonel, "Lieutenant Colonel", (token) => MacoUniformPack.decorateSwatch(macoRanks.border.lieutenantColonel, Rank.LieutenantColonel, token), "Rank.lieutenantColonel.name"),
            new Swatch(Rank.Major, "Major", (token) => MacoUniformPack.decorateSwatch(macoRanks.border.major, Rank.Major, token), "Rank.major.name"),
            new Swatch(Rank.Captain, "Captain", (token) => MacoUniformPack.decorateSwatch(macoRanks.border.captain, Rank.Captain, token), "Rank.captain.name"),
            new Swatch(Rank.FirstLieutenant, "First Lieutenant", (token) => MacoUniformPack.decorateSwatch(macoRanks.border.firstLieutenant, Rank.FirstLieutenant, token), "Rank.firstLieutenant.name"),
            new Swatch(Rank.SecondLieutenant, "Second Lieutenant", (token) => MacoUniformPack.decorateSwatch(macoRanks.border.secondLieutenant, Rank.SecondLieutenant, token), "Rank.secondLieutenant.name"),
            new Swatch(Rank.Sergeant, "Sergeant", (token) => MacoUniformPack.decorateSwatch(macoRanks.border.sergeant, Rank.Sergeant, token), "Rank.sergeant.name"),
            new Swatch(Rank.Corporal, "Corporal", (token) => MacoUniformPack.decorateSwatch(macoRanks.border.corporal, Rank.Corporal, token), "Rank.corporal.name"),
            new Swatch(Rank.Private, "Private", (token) => MacoUniformPack.decorateSwatch(macoRanks.border.private, Rank.Private, token), "Rank.private.name"),
        ];
    }
    getBorderColor(token: Token): string {
        return "#670b0e";
    }
    getRankBorderDefinitions(token: Token, bordered: boolean): string {
        return "";
    }
    getRankBorderIndicator(token: Token): string {
        switch (token.rankIndicator) {
            case Rank.Colonel:
                return macoRanks.border.colonel;
            case Rank.LieutenantColonel:
                return macoRanks.border.lieutenantColonel;
            case Rank.Major:
                return macoRanks.border.major;
            case Rank.Captain:
                return macoRanks.border.captain;
            case Rank.FirstLieutenant:
                return macoRanks.border.firstLieutenant;
            case Rank.SecondLieutenant:
                return macoRanks.border.secondLieutenant;
            case Rank.Sergeant:
                return macoRanks.border.sergeant;
            case Rank.Corporal:
                return macoRanks.border.corporal;
            case Rank.Private:
                return macoRanks.border.private;
            default:
                return "";
        }
    }
    isDivisionColorSupported(token: Token): boolean {
        return false;
    }

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.Maco) + MacoUniforms.averageMale, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.Maco) + MacoUniforms.averageFemale, BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getUniformAndVariantBody(token: Token) {
        if (token.bodyType === BodyType.AverageMale) {
            return this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.Maco)
                + MacoUniforms.averageMale.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else {
            return this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.Maco)
                + MacoUniforms.averageFemale.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        }
    }

    getRankIndicator(token: Token) {
        return "";
    }

    getBorderLogo(token: Token): string {
        return MacoUniforms.insignia;
    }

    static decorateSwatch(svg: string, rankIndicator: Rank, token: Token) {
        return `<svg viewBox="0 0 150 150" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                    <g transform="translate(14, -265)">`
                    + svg
                    + `</g>
                </svg>`;
    }
}